import React from 'react';
const Tail = () => {
    return ( 
    <div className="w3-container w3-round-xlarge w3-light-gray marin"  style={{ padding:'0.5em' }}>
    <div className="w3-padding w3-display-container " >
    <div className="w3-display-right" style={{ height: '100%' }} >
      <img src="https://www.w3schools.com/w3css/img_avatar3.png" alt="Avatar" className="w3-circle" style={{ margin: '1em', width: '40px' }} />
    </div>
    </div>
    <div className="w3-container" style={{ marginTop: '1em' }}>
      <p className="w3-text-grey" style={{ fontSize: '1.1em', marginBottom: '0.2em' }} ><b>Anger Management</b></p>
    </div>
  </div> );
}

export default Tail;
